I have not found any proof that old syntax is correct, but old file has some strange behaviour with tsc v2.0.4
part of code:

``` ts
declare module '~connect-session-sequelize' {
  import {Instance, Model} from '~sequelize/index';
  export interface TSessionAttributes {
    sid: string;
    data: string;
    expires: Date;
  }
  export interface TSessionInstance extends Instance<TSessionInstance, TSessionAttributes> {
  }

  export interface TSessionModel extends Model<TSessionInstance, TSessionAttributes> {
  }
}
```

TSessionModel did not pass type check because of method **scope**:
